def _get_mastapy_type(namespace: str, name: str) -> Type:
    key = "{}.{}".format(namespace, name)

    try:
        mastapy_module, mastapy_class = __map[key]
        module = modules.get(mastapy_module, None)

        if not module:
            module = import_module(mastapy_module)

        return getattr(module, mastapy_class)
    except KeyError:
        raise CastException(f"Failed to find suitable cast for {key}.") from None


def _get_mastapy_type_from_module_code(module_code: str) -> Type:
    try:
        mastapy_module, mastapy_class = __map_module_keys[module_code]
        module = modules.get(mastapy_module, None)

        if not module:
            module = import_module(mastapy_module)

        return getattr(module, mastapy_class)
    except KeyError:
        raise CastException(
            f"Failed to find suitable cast for {module_code}."
        ) from None
